import { Layout } from "./Card";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Layout postList={[{ id: 1 }, { id: 2 }]} />
      </header>
    </div>
  );
}

export default App;
